column8:
●カセットデッキ付きのカーステレオでポータブルオーディオ機器（デジタルオーディオ機器/iPhone/iPod/スマートフォン/WALKMAN等)の音楽を聴くことのできるカセットアダプター。<br>
●コード引き出し口が変更できるので、カセットデッキに合わせて2方向（左/右）に対応します。<br>
●高級4枚ラミネート式の磁気ヘッド採用で高音質を実現! <br>
●内部にグリス加工を施すことでカセットの回転音を極力おさえました。 <br><br>

*フロントパネルオープンタイプ（フロントパネルがカセット挿入口をふさいでしまうタイプのカセットデッキ)では、お使いいただけません。<br> 
*φ3.5ステレオミニプラグ対応のイヤホン端子がない機器ではご使用になれません。<br><br>
■仕様■<br>
コード長：110cm<br>
本体サイズ/重量：103W x 64H x 12D(mm)/40g<br>
