●カーステレオのAUX端子へ接続すると、Bluetoothを搭載した端末(iPhone/iPad/iPod/スマートフォン/タブレット等)の音楽やワンセグ音声が、ワイヤレスで聴けます。<br>
●Bluetoothバージョン3.0仕様。<br>
 従来バージョンや上位バージョン(4.0)とも互換性があり、従来/上位バージョンの携帯電話でもご使用になれます。<br>
●A2DPプロファイル SCMS-T対応。ステレオサウンドや、ワンセグTV音声にも対応。<br>
●端末を2台までマルチポイント(同時接続)可能。また4台までマルチペアリング(ペアリング設定履歴保持)可能。<br>
●車のエンジンを切ると、端末の曲が自動的に一時停止し電力消費を抑えます。またエンジンを始動すると、端末と自動的に再接続します。<br>
●最大2.1A出力、ハイパワーUSB充電ポート付。<br><br>

*USBコードは付属していません。<br>
*ハンズフリー通話はご使用になれません。<br><br>
【仕様】<br>
