●車内でスマートフォンを充電しながら、スマートフォンの音声をカーステレオから安定した音質で聴くことができる、充電器付きAUXケーブル。<br>
●車内配線がしやすい1.2m+1.2mコード仕様。<br>
●コードを巻取り、長さが調節できるコードキーパー付属。<br><br>

*カーオーディオにAUX端子口（φ3.5ステレオ）が無い車では、本製品を使用できない場合があります。<br>
*音声・充電統合のmicroUSB端子のスマートフォンでは使用できません。<br><br>

